import Header from "../../components/Header/Header";
import Footer from "../../components/Footer/Footer";
import style from './MainPage.module.css';
const MainPage = () => {

    return (
        <div className = {style['main-page']}>

            <Header />
            <Footer />
        </div>
    );
};

export default MainPage;
